import './Experience.css';

const Experience = () => {
  return (
    <div className="experience-container">
      <div className="sidebar">
        <div className="circle">
          <p className="circle-text">First experience description goes here.</p>
        </div>
        <div className="circle">
          <p className="circle-text">Second experience description goes here.</p>
        </div>
      </div>
      <div className="content">
        {/* Add your content here */}
      </div>
    </div>
  );
}

export default Experience;
